import * as React from "react";
import { styled, useTheme } from "@mui/material/styles";
import Paper from "@mui/material/Paper";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import TextField from "@mui/material/TextField";

import Link from "@mui/material/Link";
import Box from "@mui/material/Box";

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

export default function Support() {
  const [value, setValue] = React.useState("Controlled");
  const handleChange = (event) => {
    setValue(event.target.value);
  };
  return (
    <>
      {" "}
      <Grid container direction="row" alignItems="center" justify="center">
        <Paper elevation={12}>
          <Box component="form" sx={{ margin: "auto", paddingTop: "140px" }}>
            <Typography align="center" variant="h5">
              Please fill out the form below
              <br></br> and we will respond within 24 hours.
            </Typography>
          </Box>

          <Box
            alignItems="center"
            component="form"
            sx={{
              margin: "auto",
              pt: "100px",
              "& .MuiTextField-root": { m: 1, width: "25ch" },
            }}
            noValidate
            autoComplete="off"
          >
            <TextField
              required
              id="outlined-required"
              label="Email"
              helperText="* Indicates Required"
            />
            <div>
              <TextField id="outlined-input" label="First Name" type="text" />
            </div>
            <div>
              <TextField id="outlined-input" label="Last Name" type="text" />
            </div>
            <TextField
              id="outlined-input"
              label="Account Number"
              type="accountnumber"
            />
            <div>
              <TextField
                id="outlined-textarea"
                label="Message"
                placeholder="How may we help?"
                multiline
                rows={4}
              />
            </div>
          </Box>
        </Paper>
      </Grid>
    </>
  );
}
